    status: 'OPEN',
    quality_score: 90.0,
    signal_class: '⭐⭐⭐⭐⭐ (Muito Bom)',
    strategy_info: 'Baixa',
    variation: -0.47
  },
  {
    symbol: 'INITUSDT',
    type: 'SHORT',
    entry_price: 0.5531,
    target_price: 0.52165431,
    status: 'OPEN',
    quality_score: 90.0,
    signal_class: '⭐⭐⭐⭐⭐ (Muito Bom)',
    strategy_info: 'Baixa',
    variation: 1.36
  }
];

export const getSignals = async () => {
  try {
    // Por enquanto, retorna dados mockados
    return mockSignals;
    
    // Quando o backend estiver pronto, usar:
    // const response = await axios.get('http://localhost:5000/api/signals');
    // return response.data;
  } catch (error) {
    console.error('Erro ao buscar sinais:', error);
    throw error;
  }
};
